webpackJsonp([64407060579906],{6771:function(t,e){t.exports={data:{post:{html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2004/04/mausi0117.jpg" height="225" width="300" border="0" alt="Mausi 1984-2004" title="Mausi 1984-2004" /></p>\n<p>This evening we decided to end the suffering of the first, smallest, smartest and now last of our <a href="http://www.papascott.de/2000/01/17/1201.php">three American cats</a>, Mausi. Even though we\'ve been owned by several cats the past two decades, this is first time we\'ve made such a decision. We probably waited too long.</p>',fields:{title:"Last of his Kind",date:"05 Apr 2004",url:"https://papascott.de/2004-04-05-last-of-his-kind/"}}},pathContext:{slug:"/2004-04-05-last-of-his-kind/",prev:{fields:{title:"Betrayal of trust",date:"05 Apr 2004",slug:"/2004-04-05-betrayal-of-trust/"}},next:{fields:{title:"Smarty Templates and Movable Type",date:"06 Apr 2004",slug:"/2004-04-06-smarty-templates-and-movable-type/"}}}}}});
